                                    "wikipedia": [
                                        "Boiling-point elevation_0_0||Boiling-point elevation is the phenomenon whereby the boiling point of a liquid (a solvent) will be higher when another compound is added, meaning that a solution has a higher boiling point than a pure solvent. This happens whenever a non-volatile solute, such as a salt, is added to a pure solvent, such as water. The boiling point can be measured accurately using an ebullioscope.",
