                                "Janus_23_0||The rites concerning Janus were numerous. Owing to the versatile and far reaching character of his basic function marking all beginnings and transitions, his presence was ubiquitous and fragmented. Apart from the rites solemnizing the beginning of the new year and of every month, there were the special times of the year which marked the beginning and closing of the military season, in March and October respectively."
